// ChatList.js
import React from "react";

const HomePage = () => {
	const recentlyChattedUsers = [
		{ id: 1, name: "User 1" },
		{ id: 2, name: "User 2" },
		{ id: 3, name: "User 3" },
		// Add more user data as needed
	];

	return (
		<div
			style={{
				position: "relative",
				padding: "20px",
				minHeight: "200px",
			}}
		>
			<h2>Recently Chatted Users</h2>
			<ul>
				{recentlyChattedUsers.map((user) => (
					<li key={user.id}>{user.name}</li>
				))}
			</ul>

			{/* New Chat Button */}
			<button
				style={{
					position: "absolute",
					bottom: "20px",
					right: "20px",
					padding: "10px",
					fontSize: "16px",
				}}
			>
				New Chat
			</button>
		</div>
	);
};

export default HomePage;
